import { useState, useEffect } from "react";
import "./StarApi.css"
type resultProps = {
    name: string, 
    height: number, 
    mass: string, 
    hair_color:string, 
    skin_color: string, 
    eye_color: string, 
    birth_year: string, 
    gender: string, 
    homeworld: string, 
};

 const StarApi=()=> {
  const [result, setResult] = useState<resultProps[]>([]);

  useEffect(() => {
    const fectchApi = async () => {
      const data = await fetch("https://swapi.dev/api/people/", {
        method: "GET"
      });
      const jsonData = await data.json();
      setResult(jsonData.results);
    };

    fectchApi();
  }, []);

  return (
    <div className="App">
     <div className="container">
        <div className="row">
            <div >
            {
                result.map((data)=>{
                    return <div className="col-lg-3 col-md-3 col-sm-3 col-12 mb-4 position-relative text-dark" >
                    <span>{data.name}</span>
                    <span>{data.gender}</span>
                        </div>
                })
            }
            </div>

            </div> 
     </div>
        </div>
  );
}

export default StarApi;
